import React, { Component } from "react";
import { BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
import Home from "./components/0_home";
import Prob1 from "./components/Prob1";
import Prob2 from "./components/Prob2";
import Prob3 from "./components/Prob3";
import Prob4 from "./components/Prob4";
import Prob5 from "./components/Prob5";
import Prob6 from "./components/Prob6";
import Prob7 from "./components/Prob7";
import Prob8 from "./components/Prob8";
import Prob9 from "./components/Prob9";
import Prob10 from "./components/Prob10";
import Prob11 from "./components/Prob11";
import Prob12 from "./components/Prob12";
import Prob13 from "./components/Prob13";
import Prob14 from "./components/Prob14";
import Prob15 from "./components/Prob15";
import Prob16 from "./components/Prob16";
import Prob17 from "./components/Prob17";
import Prob18 from "./components/Prob18";
import Prob19 from "./components/Prob19";
import Prob20 from "./components/Prob20";
import Prob21 from "./components/Prob21";
import Prob22 from "./components/Prob22";
import Prob23 from "./components/Prob23";
import Prob24 from "./components/Prob24";
import Prob25 from "./components/Prob25";
import Prob26 from "./components/Prob26";
import Prob27 from "./components/Prob27";
import Prob27_1 from "./components/Prob27_1";
import Prob27_2 from "./components/Prob27_2";
import Prob27_3 from "./components/Prob27_3";
import Select from "./components/Select";
import End from "./components/End";
import User from "./components/User";
import mainLogo from './method-draw-image.svg'

class App extends Component {
  render() {
    return (
      <Router history="history">
        <div className="background-black">
          <nav className="navbar navbar-expand navbar-dark bg-dark">            
            <img src = {mainLogo} className="logo"></img>
            <div className='pocahome'>
              <a href= 'https://google.com' className='pocahome'> 포카전 홈 </a>
            </div>            
          </nav>

          <div>
            <Switch>
              <Route exact path={["/", "/home"]} component={Home} />
              <Route exact path="/Prob1" component={Prob1} />
              <Route exact path="/Prob2" component={Prob2} />
              <Route exact path="/Prob3" component={Prob3} />
              <Route exact path="/Prob4" component={Prob4} />
              <Route exact path="/Prob5" component={Prob5} />
              <Route exact path="/Prob6" component={Prob6} />
              <Route exact path="/Prob7" component={Prob7} />
              <Route exact path="/Prob8" component={Prob8} />
              <Route exact path="/Prob9" component={Prob9} />
              <Route exact path="/Prob10" component={Prob10} />
              <Route exact path="/Prob11" component={Prob11} />
              <Route exact path="/Prob12" component={Prob12} />
              <Route exact path="/Prob13" component={Prob13} />
              <Route exact path="/Prob14" component={Prob14} />
              <Route exact path="/Prob15" component={Prob15} />
              <Route exact path="/Prob16" component={Prob16} />
              <Route exact path="/Prob17" component={Prob17} />
              <Route exact path="/Prob18" component={Prob18} />
              <Route exact path="/Prob19" component={Prob19} />
              <Route exact path="/Prob20" component={Prob20} />
              <Route exact path="/Prob21" component={Prob21} />
              <Route exact path="/Prob22" component={Prob22} />
              <Route exact path="/Prob23" component={Prob23} />
              <Route exact path="/Prob24" component={Prob24} />
              <Route exact path="/Prob25" component={Prob25} />
              <Route exact path="/Prob26" component={Prob26} />
              <Route exact path="/Prob27" component={Prob27} />

              <Route exact path="/Select" component={Select} />
              <Route exact path="/End" component={End} />
              <Route exact path="/User" component={User} />
              <Route path="/users/:id" component={Home} />
            </Switch>
          </div>
        </div>
      </Router>
    );
  }
}

export default App;
